import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Profile navigation item to be visible and click it
    await page.waitForSelector('.nav-item[data-view="profile"]', { timeout: 5000 });
    await page.click('.nav-item[data-view="profile"]');

    // Wait for the profile view to load
    await page.waitForSelector('.main-content', { timeout: 5000 });

    // Take screenshot after clicking on Profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_view.png'));

    // Extract meaningful data to verify task completion
    const profileHeader = await page.textContent('.content-header h2');

    return {
      success: true,
      action: "Clicked on Profile navigation item to view current user's profile",
      extractedData: { profileHeader },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

